// @ts-nocheck
const METADATA = {
    website: "https://steamcommunity.com/id/Skrip037/",
    author: "Skrip",
    name: "Micro Hub",
    version: "1.0.5",
    id: "sk-hub-building",
    description:
        "Adds a new building which allows you to send shapes into the hub.",

    minimumGameVersion: ">=1.5.0",
    modId: "1863722",

    settings: {
        enabledAtLevel1: false, // Default false // True = Building is available at level 1 / False = Building is available along with the wires reward
        outputGoalShape: false, // Default false // True = Wire output enabled. This outputs the goal shape. / False = No wire output
    }
};

class MetaHubBuilding extends shapez.ModMetaBuilding {
    constructor() {
        super("SkHubBuilding");
    }

    static getAllVariantCombinations() {
        return [
            {
                name: "Micro Hub",
                description: "(2x2) Allows the player to set a small hub on the field.",
                variant: shapez.defaultBuildingVariant,

                regularImageBase64: RESOURCES.mhub.base,
                blueprintImageBase64: RESOURCES.mhub.blueprint,
                tutorialImageBase64: RESOURCES.mhub.tutorial,
            },
        ];
    }

    getSilhouetteColor() {
        return "#EB5555";
    }

    getDimensions(variant) {
        switch (variant) {
            default:
                return new shapez.Vector(2, 2);
                break;
        }
    }

    /**
     * @param {GameRoot} root
     */
    getIsUnlocked(root) {
        if (METADATA.settings.enabledAtLevel1) {
            return true;
        }
        return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_wires_painter_and_levers);
    }

    /**
     * Creates the entity at the given location
     * @param {Entity} entity
     */
    setupEntityComponents(entity) {
        entity.addComponent(
            new shapez.ItemProcessorComponent({
                inputsPerCharge: 1,
                processorType: shapez.enumItemProcessorTypes.hub,
            })
        );

        if (METADATA.settings.outputGoalShape) {
            entity.addComponent(
                new shapez.WiredPinsComponent({
                    slots: [
                        {
                            pos: new shapez.Vector(0, 1),
                            type: shapez.enumPinSlotType.logicalEjector,
                            direction: shapez.enumDirection.left,
                        },
                    ],
                })
            );
        }

        const slots = [];
        for (let i = 0; i < 2; ++i) {
            slots.push(
                { pos: new shapez.Vector(i, 0), direction: shapez.enumDirection.top, filter: "shape" },
                { pos: new shapez.Vector(i, 1), direction: shapez.enumDirection.bottom, filter: "shape" },
                { pos: new shapez.Vector(0, i), direction: shapez.enumDirection.left, filter: "shape" },
                { pos: new shapez.Vector(1, i), direction: shapez.enumDirection.right, filter: "shape" }
            );
        }

        entity.addComponent(
            new shapez.ItemAcceptorComponent({
                slots,
            })
        );

        entity.addComponent(new SkHubComponent());
    }
}

////////////////////////////////////////////////////////////////////////
class SkHubComponent extends shapez.Component {

    static getId() {
        return "SkHub";
    }

    static getSchema() {
        return {

        };
    }

    constructor() {
        super();

    }
}


////////////////////////////////////////////////////////////////////////
class SkHubSystem extends shapez.GameSystemWithFilter {
    constructor(root) {
        super(root, [SkHubComponent]);
    }

    update() {
        if (METADATA.settings.outputGoalShape) {
            for (x = 0; x < this.allEntities.length; ++x) {
                this.allEntities[x].components.WiredPins.slots[0].value =
                    this.root.shapeDefinitionMgr.getShapeItemFromShortKey(this.root.hubGoals.currentGoal.definition.getHash());
            }
        }
    }
}

class Mod extends shapez.Mod {
    init() {

        this.modInterface.registerComponent(SkHubComponent);
        // Register the new building
        this.modInterface.registerNewBuilding({
            metaClass: MetaHubBuilding,
            buildingIconBase64: RESOURCES.mhub.icon,
        });

        // Add it to the regular toolbar
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaHubBuilding,
        });

        this.modInterface.registerGameSystem({
            id: "SkHub",
            systemClass: SkHubSystem,
            before: "constantSignal",
        });
    }
}

const RESOURCES = {
    mhub: {
        base: "data:image/png;base64,",
        icon: "data:image/png;base64,",
        blueprint: "data:image/png;base64,",
        tutorial: "data:image/png;base64,",
    },
};